package com.home.commonBase.table.result;
import com.home.shine.data.DateData;
import com.home.shine.table.BaseDBResult;

/** 玩家群表(generated by shine) */
public class RoleGroupDBResult extends BaseDBResult
{
	/** 群id */
	public long groupID;
	
	/** 原区ID */
	public int createAreaID;
	
	/** 功能id */
	public int funcID;
	
	/** 创建日期 */
	public DateData createDate;
	
	/** 数据 */
	public byte[] data;
	
	@Override
	protected void toReadValues()
	{
		groupID=readLong();
		createAreaID=readInt();
		funcID=readInt();
		createDate=readDate();
		data=readBytes();
	}
	
	@Override
	public Object getPrimaryKeyByIndex(int index)
	{
		switch(index)
		{
			case 0:
				return groupID;
		}
		
		return null;
	}
	
}
